import React from 'react';
import ReactDOM from 'react-dom';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import FormControl from '@material-ui/core/FormControl'
import Input from '@material-ui/core/Input'

class HomePage extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      hello: true,
      name: "",
    }
  }

  handleName = (e) => {
  this.setState({
    name: e.target.value
  })
}
  render() {
    return (
      <div>
      <h1> Monopoly Game! </h1>
      <div>
      <p>Enter your name below to get started </p>
      </div>
      <div className="form-group">
      <Input value={this.state.password} className="form-control" placeholder="Your name"></Input>
      </div>
      <Button className="center-block" variant="contained" color="primary">Join Game</Button>
      </div>
    );
  }
}

export default HomePage
